  }
];

function App() {
  const [activeTab, setActiveTab] = useState(0); // 0 for Top 10, 1 for Remaining
  const [lastSwitch, setLastSwitch] = useState(Date.now());
  const [refreshCount, setRefreshCount] = useState(0);

  // Auto-switch tabs every 10 seconds
  useEffect(() => {
    const interval = setInterval(() => {
      setActiveTab(prev => (prev + 1) % 2);
      setLastSwitch(Date.now());
    }, 10000);

    return () => clearInterval(interval);
  }, []);

  // Auto-refresh data every 60 seconds
  useEffect(() => {
    const interval = setInterval(() => {
      setRefreshCount(prev => prev + 1);
      // Here you would typically fetch new data from your API
    }, 60000);

    return () => clearInterval(interval);
  }, []);

  const top10Candidates = sampleData.slice(0, 10);
  const remainingCandidates = sampleData.slice(10);

  const timeSinceSwitch = Math.floor((Date.now() - lastSwitch) / 1000);
  const countdown = Math.max(0, 10 - timeSinceSwitch);

  return (
    <div className="App">
      <header className="App-header">
        <h1>🏆 EC Results Live Dashboard 2025-2026</h1>
      </header>

      <div className="dashboard-container">
        <Sidebar 
          activeTab={activeTab}
          countdown={countdown}
          refreshCount={refreshCount}
          totalCandidates={sampleData.length}
          onTabChange={setActiveTab}
        />

        <main className="main-content">
          {activeTab === 0 ? (
            <div className="tab-content">
              <div className="tab-header top10">
                🏆 TOP 10 CANDIDATES
              </div>
              <div className="candidates-grid">
                {top10Candidates.map((candidate) => (
                  <CandidateCard 
                    key={candidate.id}
                    candidate={candidate}
                    isTop10={true}
                  />
                ))}
              </div>
            </div>
          ) : (
            <div className="tab-content">
              <div className="tab-header remaining">
                📊 REMAINING CANDIDATES (11+)
              </div>
              <div className="candidates-grid">
                {remainingCandidates.map((candidate) => (
                  <CandidateCard 
                    key={candidate.id}
                    candidate={candidate}
                    isTop10={false}
                  />
                ))}
              </div>
            </div>
          )}
        </main>
      </div>
    </div>
  );
}

export default App;
